import React from 'react'

export default function Settings() {
    
    function getlist()
    {
        const response = fetch('http://localhost:1337/api/anime', {
                method: 'GET',
                headers: {
                    'Content-Type': 'application/json',
                },
            })

        const data = response.json()

        console.log(data.actionList)
    }

    
    return (
    <div>Settings</div>
  )
}
